import React from 'react';
import './formulario.css';

const Menu = () => {
  return (
  <menu className="nav">
    <nav className="navbar">
      <div className="menuNav">
        <img src="https://e7.pngegg.com/pngimages/104/119/png-clipart-orange-and-white-logo-computer-icons-icon-design-person-person-miscellaneous-logo-thumbnail.png" alt="Usuario" />
        <a href="./index.html">Inicio</a>
        <img src="ruta/a/tu/imagen.jpg" alt="Usuario" />
        <a href="CrearEvento.html">Eventos</a>
        <img src="ruta/a/tu/imagen.jpg" alt="Usuario" />
        <a href="CrearTipo.html">Tipo de evento</a>
        <img src="ruta/a/tu/imagen.jpg" alt="Usuario" />
        <a href="competencias.php">Competencias</a>
      </div>
    </nav>
  </menu>
  );
};

export default Menu;
